		                      <i className="fas fa-list-ul fa-6x"></i>
		                      <h2 className="float-right font-weight-bold" style={{fontSize: '40px', textAlign: 'center'}}>xx <span className="d-block">xxxxxxxxxx</span></h2>
		                    </div>
				            
				          </div>
				          
				      </div> 
				      <div className="col-8 ">
				        <h2 style={{backgroundColor: '#ed7e24'}} className="text-white p-2 ">The data</h2>
				        <div className="container d-flex justify-content-center">
				        
				        <table className="table mt-3">
				          <thead className="table-dark">
				            <tr>
				              <th>#</th>
				              <th>id</th>
				              <th>Type</th>
				              <th>Adresse</th>
				              <th>Code Postal</th>
				              <th>Ville</th>
				              <th>Action</th>
				            </tr>
				          </thead>
				          <tbody>

				          </tbody>
				        </table>
				      </div>
				    </div>
				      
				    </div>
				</div>
				
				{infos.length > this.state.personPerPage ? <ReactPaginate pageCount={Math.ceil(infos.length/this.state.personPerPage)} pageRangeDisplayed={2}  marginPagesDisplayed={2} onPageChange={(data) =>this.paginate(data.selected+1)} containerClassName={"pagination"} previousLabel={"précédent"} nextLabel={"suivant"}/> : ''}
